import React, { useState,useEffect } from 'react'
import services from '../../services/services';
import QuestionList from './QuestionList';
import Form from '../form/Form';
import Footer from '../footer/Footer';

function QuestionApi() {
   const [question,setQuestion]=useState([])
    var categoryId = JSON.parse(localStorage.getItem("categoryId"));
    console.log(categoryId);
    useEffect(() => {
        getQuestionlist();
    }, [1])

    const getQuestionlist = async () => {
        const data={
            categoryId:categoryId
        }
        console.log(data)
        const options = {
            method: 'POST',
            headers: {
                "Apiuserid": "49507884",
                "Scope": "In.QuizApp.READ",   
            }
        }
        const result = await services.getQuestionlist(data,options)
        console.log(result)
        setQuestion(result.data.data)
    };

    return (
        <>
        <div>
            {
                question?.length &&
                <QuestionList questionlist={question}  />

            }

        </div>
        <Footer/>
        </>
    )
}

export default QuestionApi
